import React from "react";
import { CloseIcon, Icon, SidebarContainer } from "./SidebarElements";

const Sidebar = () => {
  return (
    <SidebarContainer>
      <Icon>
        <CloseIcon />
          </Icon>
          <SidebarWrapper>
              <SidebarMenu>
                  <SidebarLink to="about">

                      ab
                  </SidebarLink>
              </SidebarMenu>
          </SidebarWrapper>
    </SidebarContainer>
  );
};

export default Sidebar;
